  agent: {
    id: "",
    email: ""
  },
  house_id: ""
};
const RequestView = props => {
  const onClick = event => {
    const { buyer, agent, house } = props;
    let agentReviewList = []
    
      props.firebase
        .addRequestView({ buyer, agent, house }, agent.id);
  };

